use strict;
BEGIN {require './Snv.pm';}
use WWW::CSRF qw(generate_csrf_token check_csrf_token CSRF_OK);

my $snv         = new Snv;
my $cgi         = new CGI;
my $sname       = $cgi->param('sname');

$snv->printHeader();
my ($dbh, $user, $csrfsalt) = $snv->loadSessionId();

#$sname          = $snv->htmlencode($sname);

print qq(
<script type="text/javascript">
\$.getScript( "/EVAdb/evadb/autocompletePhenotype.js" )	
</script>
);
print qq(<link rel="stylesheet" type="text/css" href="/EVAdb/evadb/hpo_list.css">);
	
$snv->showMenu("importHPO");
print "<span class=\"big\">Import HPO</span><br><br>" ;

print "<div position: static;>";
print "<form action=\"importHPODo.pl\" method=\"post\" name=\"hpoform\">\n" ;

my $csrf_token = generate_csrf_token($user, $csrfsalt);
print qq(
<input name="wwwcsrf" type= "hidden" value="$csrf_token"><br>
);

print qq(
<DIV style="width: 700px; overflow: auto;  text-align: left;  position: static;">
	<input type="text"    name="samplename"  value="$sname" placeholder="enter sample ID here"><br>
	<input type="text" id="terms" name="query" size="50" value="" placeholder="enter phenotype here" onInput="SubmitAutocompletionPhenotype()">
	<input type="submit" value="Submit">
	<textarea name="phenotype" rows="10" style="width: 99%"></textarea>
</DIV>
);		

print "<br>";

print qq(<div id="phenotype_choices" style="visibility: visible; width: 700px;  z-index: 99; height: 30em; display:none; background-color:white; overflow-y: scroll; position:static;">Your results will display here</div>\n);					

# static HPO list
my $list = &list();
print "<br>$list\n";

print qq(
<script type="text/javascript">
\$(hpoform.query).bind('keypress', function(e)
{
   if(e.keyCode == 13)
   {
      return false;
   }
});
\$(hpoform.samplename).bind('keypress', function(e)
{
   if(e.keyCode == 13)
   {
      return false;
   }
});
</script>
);

print "</form>" ;

#print qq( <script type="text/javascript" src="/gif/autocompletePhenotype.js"></script> );
print "</div>";

$snv->printFooter($dbh);


